INSERT INTO cmm_cd_comcd(b_class_cd, s_class_cd, s_class_cd_order, b_class_cd_nm, s_class_cd_nm, cd_exp) VALUES ('ENTTYP','01','1','기업형태','대기업','대기업이란 일정 규모 이상의 자산 및 종업원을 갖추고 큰 매출을 올리는 기업을 뜻한다');
INSERT INTO cmm_cd_comcd(b_class_cd, s_class_cd, s_class_cd_order, b_class_cd_nm, s_class_cd_nm, cd_exp) VALUES ('ENTTYP','02','2','기업형태','중기업','법 제2조제2항에 따른 중기업(中企業)은 중소기업 중 제1항에 따른 소기업을 제외한 기업으로 한다');
INSERT INTO cmm_cd_comcd(b_class_cd, s_class_cd, s_class_cd_order, b_class_cd_nm, s_class_cd_nm, cd_exp) VALUES ('ENTTYP','03','3','기업형태','벤처기업','다른 기업에 비해 기술성이나 성장성이 상대적으로 높아, 정부에서 지원할 필요가 있다고 인정하는 중소기업을 말합니다');
INSERT INTO cmm_cd_comcd(b_class_cd, s_class_cd, s_class_cd_order, b_class_cd_nm, s_class_cd_nm, cd_exp) VALUES ('ENTTYP','04','4','기업형태','공공기관','공공기관이란 정부의 투자·출자 또는 정부의 재정지원 등으로 설립·운영되는 기관으로서 공공기관의 운영에 관한 법률 제4조 1항 각호의 요건에 해당하여 기획재정부장관이 지정한 기관을 의미합니다');
INSERT INTO cmm_cd_comcd(b_class_cd, s_class_cd, s_class_cd_order, b_class_cd_nm, s_class_cd_nm, cd_exp) VALUES ('ENTTYP','05','5','기업형태','외국계기업','우리나라가 아닌 다른 나라 계열의 기업');
INSERT INTO cmm_cd_comcd(b_class_cd, s_class_cd, s_class_cd_order, b_class_cd_nm, s_class_cd_nm, cd_exp) VALUES ('ENTTYP','06','6','기업형태','중견기업','중견기업은 중소기업, 공공기관 및 지방공기업, 비영리법인이 아니며, 소유와 경영의 실질적인 독립성 등의 기준을 충족하고, 일정한 업종을 영위하는 기업을 말합니다');
INSERT INTO cmm_cd_comcd(b_class_cd, s_class_cd, s_class_cd_order, b_class_cd_nm, s_class_cd_nm, cd_exp) VALUES ('ENTTYP','07','7','기업형태','소기업','법 제2조제2항에 따른 소기업(小企業)은 중소기업 중 해당 기업이 영위하는 주된 업종별 평균매출액등이 기준에 맞는 기업으로 한다');
INSERT INTO cmm_cd_comcd(b_class_cd, s_class_cd, s_class_cd_order, b_class_cd_nm, s_class_cd_nm, cd_exp) VALUES ('ENTTYP','08','8','기업형태','소상공인','소상공인은 상시근로자수 5인 이하(제조업, 광업, 건설업, 운수업체는 10인 이하)의 사업자를 말한다');
INSERT INTO cmm_cd_comcd(b_class_cd, s_class_cd, s_class_cd_order, b_class_cd_nm, s_class_cd_nm, cd_exp) VALUES ('ENTTYP','09','9','기업형태','청년친화강소기업','중앙정부와 지방자치단체, 민간기관 등에서 우수기업으로 선정된 기업*을 대상으로 ▲기업신용도 ▲임금체불이력 ▲산업재해율 ▲고용안정성 등을 기준으로 안정성과 성장가능성을 종합평가하여 선정한 강한 경쟁력을 가진 우수기업입니다');
INSERT INTO cmm_cd_comcd(b_class_cd, s_class_cd, s_class_cd_order, b_class_cd_nm, s_class_cd_nm, cd_exp) VALUES ('ENTTYP','10','10','기업형태','보호대상중견기업','상호출자제한 기업집단 소속 회사가 직전년도 매출액 3,000억원 미만인 중견기업과 하도급 거래를 하는 경우에 60일 이내에 대금을 지급하도록 하는 등의 대금 지급 관련 규정이 적용되도록 했습니다.보호대상이 되는 중견 기업은 직전년도 매출액이 중소기업기본법 상 <업종별 중소기업 규모기준 상한액>의 2배 미만인 중견기업 입니다.');
INSERT INTO cmm_cd_comcd(b_class_cd, s_class_cd, s_class_cd_order, b_class_cd_nm, s_class_cd_nm, cd_exp) VALUES ('ENTTYP','11','11','기업형태','한시성중소기업','중소기업법 제2조 3항에 따라 어떤 중기업이 규모가 확대되어 더 이상 중소기업에 해당하지 않게 되면 대기업으로 분류하기 전 3년간의 유예기간을 두게 되는데, 이와 같이 유예기간에 있는 업체를 한시성 중소기업이라고 합니다');
